create table serie
(
    id          int auto_increment
        primary key,
    titolo      varchar(255) not null,
    descrizione text         not null,
    trailer     varchar(255) null,
    copertina   mediumblob   not null,
    conclusa    tinyint(1)   not null
);

INSERT INTO moviemania.serie (id, titolo, descrizione, trailer, copertina, conclusa) VALUES (1, 'Breaking Bad', 'Walter White è un professore di chimica di Albuquerque. Vive con la moglie Skyler, incinta della loro secondogenita, e il figlio Walter Jr, affetto da un handicap motorio che gli causa difficoltà nel linguaggio e che lo obbliga a camminare tramite delle stampelle. Alla soglia del compimento dei cinquant\'anni, Walter è costretto a svolgere un secondo lavoro come dipendente di un autolavaggio, per far fronte alle difficoltà economiche previste dall\'imminente nascita della figlia. A tutto questo si aggiunge il profondo senso di insoddisfazione di Walter, il quale deve sopportare le angherie del suo titolare, dei suoi amici ed anche quelle dei suoi familiari, che lo considerano una nullità. In particolare, suo cognato Hank, il quale lavora presso la DEA, non perde occasione per mettere a confronto la sua vita, estremamente dinamica ed avventurosa, con quella di Walter, totalmente priva di soddisfazione. Quando a Walter viene diagnosticato un cancro ai polmoni, i suoi problemi sembrano precipitare. Tuttavia, in seguito al casuale incontro con Jesse Pinkman, un suo ex-studente diventato uno spacciatore di poco conto, Walter decide di sfruttare le sue conoscenze chimiche per "cucinare" metanfetamina di elevata purezza, con i cui guadagni può assicurare un futuro economico alla sua famiglia.', 'https://www.youtube.com/embed/VFLkMDEO-Xc', , 1);
INSERT INTO moviemania.serie (id, titolo, descrizione, trailer, copertina, conclusa) VALUES (2, 'Il trono di spade', 'La serie racconta le avventure di molti personaggi ed è ambientata in un grande mondo immaginario costituito principalmente dal continente Occidentale (Westeros) e da quello Orientale (Essos). Il centro più grande e civilizzato di Westeros è la città capitale Approdo del Re, dove si trova il Trono di Spade dei Sette Regni. La lotta per la conquista del trono porta le più potenti e nobili famiglie del continente a scontrarsi o allearsi tra loro in un contorto gioco di potere, che coinvolge anche l\'ultima discendente della dinastia regnante deposta. Gli intrighi politici, economici e religiosi dei nobili lasciano la popolazione nella povertà e nel degrado, mentre il mondo viene minacciato dall\'arrivo di un inverno diverso dai precedenti, che risveglia creature leggendarie dimenticate e fa emergere forze oscure e magiche.', 'https://www.youtube.com/embed/Go63zt4yx4U?start=2', , 1);
INSERT INTO moviemania.serie (id, titolo, descrizione, trailer, copertina, conclusa) VALUES (3, 'Stranger Things', 'La scomparsa di un ragazzino in una cittadina porta alla luce un mistero in cui si mescolano esperimenti segreti, spaventose forze soprannaturali e una strana bambina.', 'https://www.youtube.com/embed/ZFlPFCd-K5k?start=2', , 0);
INSERT INTO moviemania.serie (id, titolo, descrizione, trailer, copertina, conclusa) VALUES (4, 'Friends', 'Friends è una sitcom americana trasmessa in USA dal 1994 al 2004. La serie descrive un gruppo di amici (da cui il titolo) del circondario di Manhattan a New York, i loro rapporti e le loro interazioni reciproche. E\' stata una delle serie più seguite del decennio, la puntata finale è stata vista da più di 52 milioni di persone nei soli Stati Uniti, facendone il quarto finale più visto di tutti i tempi e il primo dell\'ultimo decennio.', 'https://www.youtube.com/embed/813bZYxnwYA', , 1);
INSERT INTO moviemania.serie (id, titolo, descrizione, trailer, copertina, conclusa) VALUES (5, 'La casa di carta', 'Otto ladri si barricano nell\'edificio della Zecca spagnola con alcuni ostaggi, mentre una mente criminale manipola la polizia per mettere in atto il suo piano.', 'https://www.youtube.com/embed/M8tbvWujpWA', , 1);
